snippet.description:
You know the deal by now: we build, we break, we fix, we break again. It’s the Hoonigan way. After a week or so of final buttoning up, Suppy has the Kei truck ALIVE and running. First thing’s first, we hit the East coast dyno to see what kind of numbers this thing will put down. Sure, an NA 13b rotary might not seem to be the powerhouse a lot of us thought it would be… but in a micro truck that weighs nothing, it should be enough to party. 

Want a chance to win Zac’s Chevy C10 Chopper hauler? Check it out at www.hoonigan.com/giveaway for your chance to call it your own.

We’ve got channels for all your car content needs. Subscribe, nerds.

