snippet.description:
O ao vivo muitas vezes não é coisa de Deus não. Mas nos proporciona momentes excelentes de zoeira, erros e gafes. E esses aí do jornalismo esportivo foi brabo!

Produção: Lucas Vechi, Pedro Certezas e Casimiro Miguel
Edição: Fernando Mota

PROGRAMAÇÃO CANAL DE SOLA:

- Esquetes com Cazé e Certezas, toda quarta às 11h;
- Alê Oliveira Responde, toda quinta às 19h;
- Programa De Sola com Cazé e Certezas, todo sábado às 11h;
- VAR do Alê Oliveira, todo domingo às 11h

